import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Radium, {StyleRoot} from 'radium';
import Header from './Header/Header';
import Footer from './Footer/Footer';


function App() {
  return (
    <StyleRoot>
    <div className="App">
        <Header></Header>

        <Footer></Footer>
    </div>
    </StyleRoot>
  );
}

export default Radium(App);
